import React from 'react';
import './App.css';
import logo from './assets/stackline_logo.svg';

function App() {
  return (
    <div className='product_page'>
    <div className='app-header'>
      <img src={logo} alt="Stackline logo" className='logo'/>
    </div>
    </div>
  );
}

export default App;
